import React from "react";
import "../styles/pages/approach.scss";

const Approach = () => {
  return (
    <div>
    <section className='main'>
      <div className='container'>
        <div className='row'>
          <h2>
            <div className='line'>
              <span>Get in touch with us</span>
            </div>
            <div className='line'>
              <span>for Business Inquiry</span>
            </div>
          </h2>
        </div>
      </div>
    </section>

    <div className="responsiveGrid">
         {
            tiles.map((tile:ITileData,i:number)=>
                 <div key={i} className="tileData">
                  <div className="tile">
                    <div className="title">{tile.title}</div>
                    <div className="image">
                      <img src={tile.image}/>
                    </div>
                  </div>
                </div>
            )
          }
      </div>
    </div>
  );
};

export default Approach;
